import profileAvatarBtnEdit from '../images/Edit.svg';
import profileAvatar from '../images/image.jpg';
import profileBtnEdit from '../images/EditButton.svg';
import btnAddCard from '../images/AddButton.svg';
import btnDeleteCard from '../images/Trash.svg';
import btnLikeCard from '../images/Vector.svg';
import api from '../utils/Api.js';
import { useEffect, useState } from 'react';

function Main({ onEditAvatar, onEditProfile, onAddPlace }) {
  const [userName, setUserName] = useState();
  const [userDescription, setUserDescription] = useState();
  const [userAvatar, setUserAvatar] = useState();
  const [cards, setCadrs] = useState();

  useEffect(() => {
    api
      .getUserInfo()
      .then((data) => {
        setUserName(data.name);
        setUserDescription(data.about);
        setUserAvatar(data.avatar);
      })
      .catch((err) => {console.log(err)});
  }, []);

  useEffect(() => {
    api
      .getInitialCards()
      .then(item => {
        setCadrs(item);
      })
      .catch((err) => {console.log(err)});
  }, []);

  return (
    <main className="content">
      <section className="profile">
        <div className="profile__avatar">
          <button className="profile__avatar-btnedit" type="button" onClick={onEditAvatar}>
            <img className="profile__avatar-edit" src={profileAvatarBtnEdit} alt="Кнопка редактирования" />
          </button>
          <img className="profile__avatarimg" style={{ backgroundImage: `url(${userAvatar})` }} alt="Аватар" />
        </div>
        <div className="profile__info">
          <div className="profile__info-title">
            <h1 className="profile__info-name">{userName}</h1>
            <button className="profile__info-btnborder" type="button" onClick={onEditProfile}>
              <img className="profile__info-btn" src={profileBtnEdit} alt="Кнопка редактирования" />
            </button>
          </div>
          <p className="profile__info-identity">{userDescription}</p>
        </div>
        <button className="profile__button" type="button" onClick={onAddPlace}>
          <img className="profile__button-plus" src={btnAddCard} alt="Кнопка добавления" />
        </button>
      </section>
      <section className="cards" id="cards">
        <template id="cardTemplate">
          <article className="card">
            <button className="card__delete" type="button">
              <img className="card__trash" src={btnDeleteCard} alt="Кнопка удаления" />
            </button>
            <img className="card__image" style={{ backgroundImage: `url(${card.link})` }} alt="#" />
            <div className="card__title">
              <h2 className="card__name">{card.name}</h2>
              <div className="card__like-container">
                <button className="card__like" type="button">
                  <img src={btnLikeCard} alt="Кнопка лайк" />
                </button>
                <p className="card__like-number">{card.likes}</p>
              </div>
            </div>
          </article>
        </template>
      </section>
    </main>
  )
}

export default Main;
